import React from "react";
import "./topbar.css";

function Topbar() {
  return (
    <>
      <div className="top">
        <div className="topLeft"></div>
        <div className="topCenter"></div>
        <div className="topRight"></div>
      </div>
    </>
  );
}

export default Topbar;
